import './app.css';
import HomePage from "../src/HomePage";
import Login from "../src/components/Login/Login"
function App() {
  return (
    <div className="app">
      <div className="section">
        <BrowserRouter></BrowserRouter>
        <Routes>
            <Route exact path="/" element={<HomePage/>}/>
            <Route exact path="/login" element={ <Login/>} />
         </Routes>

      </div>

    </div>
  );
}

export default App;
